     "type": "html",
     "name": "question1",
     "html": "<p></p><h4 style=\"text-align:Right\">\nNorthwestern University</h4><p></p>\n\n<p></p><h4 style=\"text-align:Right\">\nScreening Script</h4><p></p>\n\n<h3 style=\"text-align:center\"><p><b>\nNorthwestern University</b></p></h3>\n<h3 style=\"text-align:center\"><p><b>\nScreening Script with Consent</b></p></h3>\n<h4 style=\"text-align:center\"><p><b>\nThe HEALthy Brain and Child Development (HBCD) Study</b></p></h4>"
    },
    {
     "type": "text",
     "name": "firstName",
     "title": "Potential Participant First Name",
     "hideNumber": true,
     "isRequired": true,
     "readOnly": true,
