     "html": "<p style=\"text-align:left;color:black;font-size:16px\">Please use this QR code to access the LORIS profile that corresponds to this participant. Use the “<u>Begin Participant Workflow</u>” button on the LORIS homepage. You will need to scan the code again each time you access an instrument in LORIS. <b>The Birth Parent QR code is used for visit V01 only!</b></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Note: You may have to wait up to 15 minutes after completing the consent form for your participant's QR code to be available.</p>"
