     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:center;color:black;font-size:32px\"><b>HIPAA Privacy Authorization Form</b></p>\n\n<p style=\"text-align:center;color:black;font-size:20px\">Authorization for Use or Disclosure of Protected Health Information</p>\n\n<p style=\"text-align:center;color:black;font-size:20px\">(Required by the Health Insurance Portability and Accountability Act ---- 45 CFR Parts 160 and 164)</p>\n"
    },
    {
     "type": "html",
     "name": "statement1",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:20px\">1. I, <b>{firstName} {lastName}</b>, hereby authorize <b>Northwestern University</b> to use and/or disclose the protected health information (‘‘PHI’’) described below to The HEALthy Brain and Child Development Study and its partner organizations.</p>\n"
    },
    {
     "type": "html",
     "name": "statement2",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:20px\">2. This medical information may be used by the persons I authorize to receive this information to help researchers understand how children grow and change (develop) early in life by studying many factors that might be helpful or harmful to a child’s development such as exposure to tobacco, alcohol, and other drugs before birth, family members’ mental health and stress, and the child’s exposure to toxins. The overall goal of this study is to better understand how children grow up in different environments.</p>\n"
    },
    {
     "type": "html",
     "name": "question2",
     "minWidth": "550px",
     "maxWidth": "550px",
     "html": "<p style=\"text-align:left;color:black;font-size:20px\">3. Select Delivery Method: *<br /><b>(Please check all that apply)</b></p>"
    },
    {
     "type": "checkbox",
     "name": "deliveryMethod",
     "minWidth": "550px",
     "maxWidth": "550px",
     "indent": 4,
     "titleLocation": "hidden",
