       "value": "item2",
       "text": "Mail"
      },
      {
       "value": "item3",
       "text": "Fax"
      }
     ],
     "colCount": 3
    },
    {
     "type": "html",
     "name": "statement4",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:20px\">4. Authorization for release of PHI shall be effective until the completion of the study or until revoked.</p>\n"
    },
    {
     "type": "html",
     "name": "statement5",
     "width": "350px",
     "minWidth": "350px",
     "maxWidth": "350px",
     "html": "<p style=\"text-align:left;color:black;font-size:20px\">5. I hereby authorize the release of PHI as follows: *</p>"
    },
    {
     "type": "checkbox",
     "name": "phiRelease",
     "minWidth": "550px",
     "maxWidth": "550px",
     "indent": 4,
