    {
     "type": "html",
     "name": "question2",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p></p><h4 style=\"text-align:Right\">\nUCSD Project 802055</h4><p></p>\n\n<p></p><h4 style=\"text-align:Right\">\nAdult Consent</h4><p></p>\n\n\n\n<p><br /></p><h3 style=\"text-align:center\"> <b>Northwestern University Consent to Act as a Research Subject and Parent Consent for Child to Act as a Research Subject</b></h3> <p></p>\n\n<p></p><h4 style=\"text-align:center\"><b>\nThe HEALthy Brain and Child Development (HBCD) Pilot Study</b></h4><p></p>\n\n<p><br /></p><h4 style=\"text-align:left\"><b><i>Introduction</i></b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Dr. Lauren Wakschlag and Dr. Elizabeth Norton are conducting a pilot study for research at Northwestern University, and are asking for your consent for you and your child to participate.  The purpose is to help find out if the planned study activities are acceptable and can be completed by future participants.  This pilot study will recruit between 10 and 31 pilot participants at each of 25 locations across the United States where the main study will also be done. This section provides a summary of important information. The rest of the form provides additional details.  </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The purpose of this pilot study is to inform a nation-wide research project that is intended to learn how children grow and change (develop) early in life. We will study children’s thinking, behavior, social interactions, emotions, and brains from birth through 10 years old. The research will look at many factors that might be helpful or harmful to a child’s development. These include exposure to tobacco, alcohol, and other drugs before birth, family members’ mental health and stress, the family’s social and economic environment, the child’s exposure to toxins, and how the parent or caregiver interacts with their child. The overall goal of this study is to better understand how children grow up in different environments. While there is no direct benefit to you from participating, the results of this study may help scientists design new methods for improving the lives of children and their families. </p>\n"
    },
    {
     "type": "text",
     "name": "globalID",
     "visible": false,
     "width": "550px",
     "minWidth": "550px",
     "maxWidth": "550px",
     "title": "globalID",
     "surveyVariable": "ParticipantVariable:globalId"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page3.1",
   "elements": [
    {
     "type": "html",
     "name": "question7",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">If you agree for you and or your child to participate, we will ask you to take part in completing one to two visits, either during your pregnancy, at less than 1 month of age for your child, or between 3-9 months of age for your child. These visits will take place in-person, or some parts may be done remotely. The length of visits will vary, and may last between approximately one to seven hours per visit (which can be broken up into multiple visits). This will include completing interviews, questionnaires and other tests about yourself and or your child for the visits that are planned for the first year of the study. We may ask you and or your child to wear small devices for a few days to measure heart rate and or movement. We may ask you and or your child to provide some biological samples. Because this study is looking at how a child’s brain develops in the first years of life, we may ask that you allow your child to have brain scans and other measures of how your child’s brain is developing.  </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"> The most serious potential risks of the study are the social and legal risks that could result the loss of your or your child’s confidentiality if we mistakenly share your information with someone outside the study. Every effort will be made to protect your confidentiality. All records collected from you and your child will be identified by unique study ID and will not carry personal identifiers.</p>\n\n<p><br /></p><h4 style=\"text-align:Leftt\">\nVersion 10/06/2022</h4><p></p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
