     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">The brain MRI visits will be scheduled at <u>Northwestern University Center for Translational Imaging (CTI)</u> . We will give you directions and free parking <u>(or provide transportation reimbursement)</u>. Because MRI involves being placed in a strong magnetic field, it is not safe for your child to be in or near an MRI scanner if they have metal on their body, such as pierced earrings. You will be asked to remove anything metallic from your child before the scan. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The EEGs will be done at the study location <u>at 625 N. Michigan Ave, Chicago, 60611</u>. Your child will wear a special head “net” or cap for a brief period of time while doing the study tasks.  </p>"
