     "name": "question20",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nHow much time will each study visit take and how long will the study last? </i></b></h4>\n\n<ul style=\"font-size:16px;color:black\">\n<li>The pregnancy visit will take approximately 3 hours. The separate heart rate device setup visit during pregnancy will take approximately 20 minutes. Completing the questionnaires about yourself while wearing the device will take 10 minutes.</li>\n\n<li>The study visit for a child less than 1 month of age for all study measures except MRI or mock MRI and the infant heart rate device will take approximately 2 hours.</li>\n\n<li>The separate heart rate device setup visit for a child less than 1 month of age will take approximately 20 minutes. Completing the questionnaires about your child while wearing the device will take 10 minutes.</li>\n\n<li>The study visit for a child between 3 and 9 months of age for all measures except MRI, EEG and infant heart rate device will take approximately 2 hours.</li>\n\n<li>The separate heart rate device setup visit for a child 3-9 months of age will take approximately 20 minutes. Completing the questionnaires about your child while wearing the device will take 10 minutes.</li>\n\n<li>An MRI or mock MRI visit will take approximately 3 hours.</li>\n\n<li>The EEG or mock EEG visit will take approximately 2 hours.</li>\n\n<li>Completing the survey after your visits will take approximately 10 minutes.</li>\n</ul>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page9",
   "elements": [
    {
     "type": "html",
     "name": "question21",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nWhat risks are associated with this study?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Participation in this pilot study may involve some added risks or discomforts. In addition to the risks described at the beginning of this form,</p>\n\n<ol style=\"font-size:16px;color:black\">\n<li>It is possible you or your child may become tired, bored, or frustrated during the study sessions. You and your child can take breaks and/or stop at any time.</li>\n\n<li>It is possible that being asked about your feelings, mood, or about experiences with drugs, alcohol or other substances, or questions about your child may make you feel uncomfortable. In some cases, you may skip questions that make you feel uncomfortable.</li>\n\n<li>You may feel brief pain, get a bruise or feel dizzy or faint during the blood drawn for the study during or shortly after pregnancy. The blood draw is similar to routine tests done in pregnancy, and the risks are typically minimal and do not exceed those for clinically-indicated blood draws.</li>\n\n<li>Risks with MRI:</li>\n\n<ul> <li>The MRI scanner makes loud noises when being used. Your child will be given earmuffs to help reduce the noise.</li></ul>\n\n<ul> <li>There are no known biological or reproductive risks from MRI scans. The procedure does not use radiation, like X-rays. However, because the MRI has a strong magnetic field, it is not safe to be in or around the scanner if your child has metal on his/her body (such as metal earrings). We will make sure it is safe for your child by asking you about any metal items before scheduling the scan and just prior to entering the scanner.</li></ul>\n\n<ul> <li>While in the scanner, your child may awaken or not be able to complete the scan. The study team will work with you and your child allowing as much time as needed to accommodate the child’s sleep and activity.</li></ul>\n\n<ul> <li>Although the MRI is not a diagnostic test, all scans will be reviewed by a radiologist. It is possible that we may detect an unexpected finding in the brain. This may be distressing to you. The unexpected findings will be discussed with you.</li></ul>\n</ol>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page10",
   "elements": [
    {
     "type": "html",
     "name": "question26",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">Because this is a research study, there may be some unknown risks that are currently unforeseeable. If there are significant new findings during the course of this research that may influence your willingness to continue to participate for yourself or your child, we will inform you of these findings.</p>\n\n<ul style=\"font-size:16px;color:black\">\n<li>There is a risk of possible loss of confidentiality. There may be psychological or social risks associated with loss of privacy. While we believe the risks to you, your child, and your family are very low, we are not able to tell you exactly what all of the risks are.</li>\n\n<li>Your and your child’s privacy is very important to us, and we will use many safety measures to protect your and your child’s privacy. However, even with all the safety measures that will be used, we cannot guarantee that your or your child’s identity will never become known.</li>\n\n<li>The database we use to share data from this project have many controls in place to limit who can access the data. The database will not contain information that is normally used to identify you or your child, such as name, address, telephone number or social security number. However, people may develop ways to link de-identified information in these databases back to you or your child. For example, someone could compare information in our database to other databases and be able to identify you, your child or family members.</li>\n\n<li>The database will contain the video recordings from the EEG, which will be identifiable <u>in that they will show your child's or your face or contain your child's or your voice.</u> These are needed for analysis of the EEG findings. The recordings will be stored in a secure platform and will not be shared outside of the study or used in any publications.</li>\n</ul>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page11",
   "elements": [
    {
     "type": "html",
     "name": "question29",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nWhat are the alternatives to participating in this study? </i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The alternative to participation in this pilot study is not to participate.</p>\n\n\n<br />\n<h4 style=\"text-align:left\"><b><i>\nWhat benefits can be reasonably expected? </i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You or your child will not benefit directly if you and your child decide to take part in this pilot research study. The investigators, however, will learn about the acceptability and feasibility of the activities proposed for the larger study. While not a direct benefit of the study, we will provide information to you about referrals and community support that you may wish to access for you or your child.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"></p><p style=\"text-align:left;color:black;font-size:16px\">If you are incarcerated, participation in this study will not be a factor in parole board decisions.</p>\n\n\n\n<br />\n<h4 style=\"text-align:left\"><b><i>\nWhat happens if you change your mind about participating?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Participation in this pilot research is entirely voluntary. You may refuse to participate or withdraw at any time without penalty or loss of benefits to which you or your child are entitled. If you decide that you and your child no longer wish to continue in this pilot study, you may notify Dr. Wakschlag in writing to Northwestern University, Department of Medical Social Sciences, Feinberg School of Medicine, 625 N. Michigan, Suite 2100, Chicago, Il. 60611; by writing an email to hbcd@northwesternhealth.ucsd.edu; or calling Dr. Wakschlag at (872) 204-7882</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You will be told if any important new information is found during the course of this pilot study that may affect your wanting to continue or allow your child to continue. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page12",
   "elements": [
    {
     "type": "html",
     "name": "question39",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nCan you or your child be withdrawn from the study without your consent?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You and your child may be withdrawn from the pilot study if Dr. Wakschlag or the HBCD investigators believe it is in your or your child’s best medical interest or if you do not follow the instructions from the study personnel.</p>\n\n\n\n<br /><h4 style=\"text-align:left\"><b><i>\nWill you be compensated for participating in this study?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You will be compensated for your and your child’s time participating in the study approximately according  to  the  amount  of  time  required  to  complete  the  visit  measures  and  to  provide  the biological samples. The following compensation schedule applies to the specific activities listed for the pregnancy or infant pilot that you and your child are being asked to do.</p>\n\n<p style=\"margin:0px;text-align:left;color:black;font-size:16px\"><b>Visit 1 - Pre-natal $130 total</b>\n</p>\n\n<tr><p style=\"padding:0px;margin:0px;text-align:left;color:black;font-size:16px\">Maternal questionnaires=$70\n</p></tr>\n<tr><p style=\"padding:0px;text-align:left;color:black;font-size:16px\">Biospecimens=$60\n</p></tr>\n\n<p style=\"margin:0px;text-align:left;color:black;font-size:16px\"><b>Visit 2 - 0-1 month $260 total</b>\n</p>\n\n<tr><p style=\"padding:0px;margin:0px;text-align:left;color:black;font-size:16px\">Questionnaires - $50\n</p></tr>\n\n<tr><p style=\"padding:0px;margin:0px;text-align:left;color:black;font-size:16px\">Physical Measures - $10\n</p></tr>\n\n<tr><p style=\"padding:0px;margin:0px;text-align:left;color:black;font-size:16px\">Biospecimens - $60\n</p></tr>\n\n<tr><p style=\"padding:0px;margin:0px;text-align:left;color:black;font-size:16px\">Wearable sensors (baby) - $40\n</p></tr>\n\n<tr><p style=\"padding:0px;text-align:left;color:black;font-size:16px\">Neuroimaging-$100\n</p></tr>\n\n<p style=\"margin:0px;text-align:left;color:black;font-size:16px\"><b>Visit 3 - 3-9 months $370 total</b>\n</p>\n\n<tr><p style=\"padding:0px;margin:0px;text-align:left;color:black;font-size:16px\">Questionnaires - $55\n</p></tr>\n\n<tr><p style=\"padding:0px;margin:0px;text-align:left;color:black;font-size:16px\">Physical measures - $10\n</p></tr>\n\n<tr><p style=\"padding:0px;margin:0px;text-align:left;color:black;font-size:16px\">Biospecimens - $60\n</p></tr>\n\n<tr><p style=\"padding:0px;margin:0px;text-align:left;color:black;font-size:16px\">Wearable sensors (child) - $40\n</p></tr>\n\n<tr><p style=\"padding:0px;margin:0px;text-align:left;color:black;font-size:16px\">Neuroimaging - $110\n</p></tr>\n\n<tr><p style=\"padding:0px;text-align:left;color:black;font-size:16px\">EEG - $45\n</p></tr>\n\n<br />\n<p style=\"text-align:left;color:black;font-size:16px\">The payment will be given as cash, a gift card, or a reloadable credit card that can be used at stores, online or for cash at local banks. We will also reimburse you for transportation if needed for study visits,  and  will  provide  you  with  access  to  food,  on-site  childcare,  and  other  small  gifts  such  as diapers or a book or toy. If you move out of the study area for a certain site, you will be given the option to transition to another study site closer to your new location.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">There may be tax reporting implications if the amount of compensation you receive in a year exceeds $600. Your social security number will be obtained in order to report compensation to the IRS if the amount of compensation you receive in a year exceeds $600.</p>"
    }
   ],
