     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nWhat about your and your child’s confidentiality?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Research records will be kept confidential to the extent allowed by law. This means what you tell us is not shared outside of the HBCD investigators and study team. Your records and your child’s records with your and your child’s name and contact information will be stored separately from data collected from you in a secure password protected computer file with access restricted to limited study personnel. Research records may be reviewed by the UCSD and local site Institutional Review Boards and the people who support this study at the National Institutes of Health.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">All results of your and your child’s information (for example, your responses to interviews and questionnaires) will be identified only by aunique participant code that contains no information about your or your child’s identity. Only the research team will have the information that matches the code to your identifying information, such as your or your child’s name, address and phone number. Drs. Wakschlag and Norton and their staff will keep the information that matches the code to this identifying information in a password database for approximately 15 years or as long as the study has funding. Only very few authorized people, who have agreed to protect your and your child’s identity, will have access to this information that matches your and your child’s personal information to your unique code.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">In this coded form, the data will be entered into a database. This database will be accessible to the HBCD study researchers, and the data will also be placed in data repositories that are maintained or sponsored by the National Institutes of Health. The data will be made available broadly for research and development of new methods. This information may ultimately have significant therapeutic or commercial value. By agreeing for yourself and your child to participate in this study, you agree to such uses. Researchers who request access to your and your child’s data will have to agree not to try to identify individuals who have participated in the study. However, there is a small possibility that in the future an unauthorized attempt to identify you or your child as participants in the study could succeed.</p>\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page15",
   "elements": [
    {
     "type": "html",
     "name": "question31",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">This research is covered by a Certificate of Confidentiality from the National Institutes of Health (NIH). Researchers with this Certificate may not disclose or use information, documents, or biological samples that may identify you or your child in any federal, state, or local civil, criminal, administrative, legislative, or other action, suit, or proceeding. Researchers may not disclose of use the information, documents, or biological samples as evidence unless you have consented for this use. Information, documents, or biological samples protected by this Certificate cannot be disclosed to anyone else who is not connected with the research unless there is a federal, state, or local law that requires disclosure (such as to report child abuse, elder abuse, intent to hurt self or others, or communicable diseases), you have consented to the disclosure, including for your or your child’s medical treatment; or it is used for other scientific research, as allowed by federal regulations protecting research subjects.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">We may need to report information about known or reasonably suspected incidents of abuse or neglect of a child or elder including physical, sexual, emotional, and financial abuse or neglect. If anyone on the research team has or is given such information, they will be required to report such information to the appropriate authorities.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you or your child report intention to harm yourself or others to the research team, this will require a referral or report to the appropriate authorities. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The Certificate cannot be used to refuse a request for information from personnel of federal or state government agency sponsoring the project that is needed for auditing or program evaluation by the National Institutes of Health which is funding the project. You should also understand that a Certificate of Confidentiality does not prevent you from voluntarily releasing information about yourself and your child or your and your child’s involvement in this research. If you want your or your child’s research information released to an insurer, medical care provider, or any other person not connected with the research, you must provide consent to allow the research to release it. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page16",
   "elements": [
    {
     "type": "html",
     "name": "question32",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">If you agree to genetic uses of your or your child’s biological samples, Federal and State laws generally make it illegal for health insurance companies, group health plans, and most employers to discriminate against you or your child based on your or your child’s genetic information. This law generally will protect you and your child in the following ways: a) Health insurance companies and group health plans may not request your or your child’s genetic information that we get from this research. b) Health insurance companies and group health plans may not use your or your child’s genetic information when making decisions regarding your or your child’s eligibility or premiums. c) Employers with 5 or more employees may not use your or your child’s genetic information that we get from this research when making a decision to hire, promote, or fire you or your child or when setting the terms of your employment.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Be aware that these laws <b>do not</b> protect you or your child against genetic discrimination by companies that sell life insurance, disability insurance, or long-term care insurance.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Personal identifiers will be removed from the information collected as part of the research. After such removal, the information could be used for future research studies or distributed to another investigator for future research studies without your additional informed consent. If you consented to any of the uses of your or your child’s biological samples, this information could also be used for future research studies or distributed to other investigators for future research studies without your additional informed consent.  </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page17",
   "elements": [
    {
     "type": "html",
     "name": "question34",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">Biological samples (such as blood, saliva, urine, nails or stool) collected from you and your child for this study and/or information obtained from your or your child’s biological samples may be used in this research or other research and shared with other organizations. You will not share in any commercial value or profit derived from the use of your biospecimens and/or information obtained from them.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The biological samples will be sent to storage facility (repository) and one or more laboratories. All pilot samples from participants at all HBCD study sites will go to the same HBCD study repository.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The study laboratory may analyze your and your child’s samples to evaluate proteins, tobacco, alcohol and other drugs you may have used (including illegal drugs), toxins, environmental exposures, normal bacteria in the gut, and nutrition (the “planned study analyses”). <b>Your samples will NOT have your name or contact information on them when they go to the study repository or laboratory.</b> They will only have a code number. In order to protect against possible legal risks, the results of these tests will not be returned to the research team at your site, so they will not know the individual results for you or your child.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The study repository will store your samples so that other evaluations may be done in the future. For instance, in the future we plan to study your DNA (your genes or your whole genome) and some chemicals that turn your genes on and off (epigenetics). We will not do that research now, but we or somebody else may do it in the future.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The repository can save your samples for many years so that researchers (including researchers who are not part of the HBCD study) could use them for other future research. We do not know what that other research would be. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page18",
   "elements": [
    {
     "type": "html",
     "name": "question13",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b>\nWill you receive any results about yourself or your child from participating in this study?</b> </h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">While the study will not provide medical care, if the answers you give us in some of the questionnaires suggest that you are having serious problems with your mental health, we will let you know, and assist you in finding help. If there is something the study doctors notice when looking at your child’s MRI scan that might need further evaluation, we will let you know and assist you in deciding what you can do next.</p>"
    },
    {
     "type": "html",
     "name": "question14",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>Who can you call if you have questions?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">This study has been explained to you and your questions have been answered. If you have other questions or research-related problems, you may reach Dr. Wakschlag at (872) 204-7882.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You may call the Human Research Protections Program Office at (312-503-0826) to inquire about your or your child’s rights as a research subject or to report research-related problems. </p>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "start_hipaa",
   "elements": [
    {
     "type": "html",
     "name": "question5",
     "maxWidth": "600px",
     "html": "\n<p style=\"text-align:left;color:black;font-size:20px\"><u><b>HIPAA Authorization</b></u></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">We are committed to respect your privacy and to keep your personal information confidential.  When choosing to take part in this study, you are giving us the permission to use your personal health information that includes health information in your medical records and information that can identify you. For example, personal health information may include your name, address, phone number or social security number. Your health information we may collect and use for this research includes</p>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Results of physical examinations</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Medical history</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Lab tests, or certain health information indicating or relating to a particular condition as well diaries and questionnaires</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>HIV testing results</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Substance Use Disorder information: [All substance use disorders information.]</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Mental Health information: [All mental health diagnosis.]</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Genetic Testing information: [All genetic testing information.]</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Sexual Assault/Abuse</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Child Abuse and Neglect</li></ul>\n\n\n<p style=\"text-align:left;color:black;font-size:16px\">You have the right to inspect and copy the mental health and developmental disabilities, and genetic counseling records that will be collected as part of this study.</p>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page23",
   "elements": [
    {
     "type": "html",
     "name": "question8",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">During this study, you may be coming to a Northwestern Memorial HealthCare/Northwestern Medicine entity for research appointments or to get clinical services, such as lab tests, needed for the study.  When that happens, you will be scheduled for these services through the NMHC computer system.  When a clinical exam or lab is done by NMHC or one of its employees for the purpose of this research study, that information will be kept in both NMHC’s clinical records and in the study records.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The following clinical providers may give the researchers information about you:  all current and previous health care providers, including but not limited to the Shirley Ryan AbilityLab (SRALAB) and Northwestern Memorial HealthCare/Northwestern Medicine entities and its current and future affiliates.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Once we have the health information listed above, we may share some of this information with the following offices or entities outside of Northwestern University and its clinical partners (or affiliates):  the Northwestern University Institutional Review Board Office and Office for Research Integrity; the US Office of Research Integrity; the US Office for Human Research Protections; the US Food and Drug Administration. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Any research information shared with outside entities will not contain your name, address, telephone or social security number or any other personal identifier unless disclosure of the identifier is necessary for review by such parties or is required by law or University policy [except that such information may be viewed by the Study sponsor and its partners or contractors at the Principal Investigator’s office].</p>\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page24",
   "elements": [
    {
     "type": "html",
     "name": "question9",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">The following entities may receive your health information</p>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Authorized members of the Northwestern University workforce, who may need to see your information, such as administrative staff members from the Office for Research, Office for Research Integrity and members of the Institutional Review Board.</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Other University research centers and University contractors who are also working on the study,</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li>Study monitors and auditors who make sure that the study is being done properly,</li></ul>\n\n<ul style=\"text-align:left;color:black;font-size:16px\"> <li> [National Institute on Drug Abuse (NIDA).], who is sponsoring the study, and that company’s contractors and partners.</li></ul>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Those persons who get your health information may not be required by Federal privacy laws (such as the Privacy Rule) to protect it. Some of those persons may be able to share your information with others without your separate permission.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Also, Federal law/42 CFR Part 2 prohibits unauthorized disclosure of these records.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The results of this study may also be used for teaching, publications, or for presentation at scientific meetings. </p>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page25",
