    {
     "type": "html",
     "name": "question69",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">This consent expires on 04/04/2037. After this date, Northwestern University may not gather new information about you, use or disclose your personal health information collected in this study for any purpose other than the research study described in this consent unless Northwestern University obtains permission to do so from you.  Illinois State Law permits use and disclosure of your mental health information only to the extent specified in this document.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Although you may revoke consent to participation in this research in writing, via email or by calling Dr. Wakschlag, you must revoke authorization for use or disclosure of your health information in writing. The written revocation should include your signature and the signature of the person who witnessed you signing the revocation.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">To revoke your authorization, write to:</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">  PI’s Name: Lauren S. Wakschlag, PhD </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">  Institution: Northwestern University</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">  Department: Department of Medical Social Sciences</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">  Address: 625 N Michigan Ave, Chicago, IL 60211</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You do not have to authorize the use or disclosure of your health information; however, you will not be allowed to take part in this research study. If you do not authorize the use or disclosure of your health information, it will not affect your treatment by health care providers, or the payment or enrollment in any health plans, or affect your eligibility for benefits.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">A copy of this signed consent document, information about this study, and the results of any test or procedure done may be included in your medical records and may be seen by your insurance company.</p>\n"
    }
   ],
